import {Router,Route} from "react-router-dom";
import Login from "../Login/Login";

const AppRoutes = (props) => {
    return (
        <>
            <Router>
                <Route path="/login" element={<Login/>}/>
            </Router>
        </>
    )
}

export default AppRoutes;
